import  React  from "react";
import {ProgressBar} from 'primereact/progressbar';


class check extends React.Component{
    constructor()
    {
        super();
    }

    render(){
        return(
            <div className="col-xl-3 col-md-6">
              <div className="card" style={{height:"360px"}}>
                <div className="card-body">
                    <span>Highest Active Cases</span><br></br>
                    <span style={{float:"left"}}>USA</span><ProgressBar value="40" showValue ={false} style={{height:'13px'}} />
                    <span>State with Highest Recovered Cases</span><br></br>

                    <span>State with Highest Death Cases</span>

                </div>
              </div>
            </div>
        )
    }
}

export default check;
